window.bookSummaryJSON = "<p><i>New York Times</i> best-selling author Barbara Hambly returns to the <i>Star Wars</i> universe to tell a breathtaking tale of a mysterious world where the battle between the New Republic and the Empire takes a shocking new twist.</p> <p>Nam Chorios is a barren backwater planet that was once a dreaded prison colony and is now home to a fanatical religious cult. It is here that Princess Leia has been taken captive by a ruthless and charismatic warlord bent on destroying the New Republic. Meanwhile, Luke lands on a mysterious planet in search of his lost love, Callista, only to discover the Force is his own worst enemy. But worst of all, as Han, Chewie, and Lando leave Coruscant on a desperate rescue mission, a strange life-form, unlike any the galaxy has ever seen, awakens - a life-form so malevolent it will destroy everything, both Empire and New Republic, on its path to domination.</p>"; 
